from sympy import prime, primefactors
def is_pi_complete(n): # Check for complete set of
    factors = primefactors(n) # prime factors
    return factors[-1] == prime(len(factors))
def aupto(limit):
    result = []
    for i in range(1, limit+1):
        n = i * (i+1) * (i+2)
        if is_pi_complete(n):
            result.append(n)
    return result
print(aupto(100_000))

